package client.state;

public class BombState {
    public int tileX;
    public int tileY;
    public int range;

    public double timer;        // waktu tersisa (server yg update)
    public boolean exploded;

    public BombState(int tileX, int tileY, int range, double timer, boolean exploded) {
        this.tileX = tileX;
        this.tileY = tileY;
        this.range = range;
        this.timer = timer;
        this.exploded = exploded;
    }
}
